import styled from "styled-components";


export const Footer = styled.footer`

    height: 150px;
    display: flex;
    align-items: center;
    flex-direction: column;
    justify-content: center;
    background-color: #eee;
    color: #444;
    border-top: 1px solid #f1008e;
    
    span{
        font-weight: bold;
        
    }
    

`
